    font-size: 13px;
    line-height: 30px;
    border-top: 0.5px solid #e0e0e0;
}

#wrapper {
    width: 100%;
    height: 100%;
}

body {
    margin: 0;
    height: 100%;
    width: 100%;
    overflow: hidden;
}

/** Document editor sample level styles*/

#panel {
    height: 100%;
    width: 100%;
    user-select: none;
    -moz-user-select: none;
    -khtml-user-select: none;
    -webkit-user-select: none;
    -o-user-select: none;
}

#documenteditor_container_panel {
    width: 100%;
    height: 100%;
    border: solid 1px #D9D9D9;
}


.overlay {
    z-index: 10;
    display: none;
    position: fixed;
    background-color: #383838;
    height: 100%;
    width: 100%;
    opacity: .5;
    left: 0;
    top: 0;
}


[contenteditable="true"].single-line {
    white-space: nowrap;
    border-color: #e4e4e4 !important;
}

[contenteditable="true"].single-line * {
    white-space: nowrap;
}
#documenteditor_titlebar {
    height: 36px;
    line-height: 26px;
    width: 100%;
    font-size: 12px;
    padding-left: 15px;
    padding-right: 10px;
    font-family: inherit;
}

#documenteditor_title_contentEditor {
    height: 26px;
    max-width: 85%;
    width: auto;
    overflow: hidden;
    display: inline-block;
    padding-left: 4px;
    padding-right: 4px;
    margin: 5px;
}


.single-line {
    cursor: text !important;
    outline: none;
}

    .single-line:hover {
        border-color: #e4e4e4 !important;
    }

[contenteditable="true"].single-line {
    white-space: nowrap;
    border-color: #e4e4e4 !important;
}


